import React from 'react';
import Home from './pages/Home';
import Layout from './components/Layout';

class App extends React.Component {
  static displayName = App.name;

  constructor(){
    super();
  }

  render (){
    return (
      <Layout>
        <Route exact path='/' component={Home} />
      </Layout>
    );
  }
}

export default App;
